import React, { useState } from "react";

type MatrixDisplayProps = {
  matrix: number[][];
  title?: string;
};

const MatrixDisplay: React.FC<MatrixDisplayProps> = ({ matrix, title }) => {
  const [lambdaMax, setLambdaMax] = useState<number>(0);
  const [IS, setIS] = useState<number>(0);
  const [OS, setOS] = useState<number>(0);

  // Функция обновления значения ячейки
  const updateValue = (rowIndex: number, colIndex: number, newValue: number) => {
    const newMatrix = [...matrix];
    newMatrix[rowIndex][colIndex] = newValue;
    setMatrix(newMatrix);
  };

  // Генерация второй матрицы 4xN
  const matrix4 = [
    ['x', 'w', 'M * w', 'λ * w'], // используем символ λ для lambda
    ...matrix.map((row, rowIndex) => row.map((cell, colIndex) => (
      <EditableCell
        value={cell}
        rowIndex={rowIndex}
        colIndex={colIndex}
        updateValue={updateValue}
      />
    ))),
  ];

  return (
    <div style={styles.container}>
      {title && <h3 style={styles.title}>{title}</h3>}

      {/* Первая матрица */}
      <Matrix table={matrix} />

      {/* Вторая матрица 4xN */}
      <Matrix table={matrix4} />

      {/* Поля для ввода */}
      <div style={styles.inputContainer}>
        <label style={styles.inputLabel}>λmax:</label>
        <input
          type="number"
          value={lambdaMax}
          onChange={(e) => setLambdaMax(parseFloat(e.target.value).toFixed(2))}
          style={styles.input}
        />
        <label style={styles.inputLabel}>ИС:</label>
        <input
          type="number"
          value={IS}
          onChange={(e) => setIS(parseFloat(e.target.value).toFixed(2))}
          style={styles.input}
        />
        <label style={styles.inputLabel}>ОС:</label>
        <input
          type="number"
          value={OS}
          onChange={(e) => setOS(parseFloat(e.target.value).toFixed(2))}
          style={styles.input}
        />
      </div>
    </div>
  );
};

// Компонент для отображения таблицы
const Matrix: React.FC<{ table: any[] }> = ({ table }) => (
  <table style={styles.table}>
    <tbody>
      {table.map((row, rowIndex) => (
        <tr key={rowIndex}>
          {row.map((cell, cellIndex) => (
            <td key={cellIndex} style={styles.cell}>
              {cell}
            </td>
          ))}
        </tr>
      ))}
    </tbody>
  </table>
);

// Редактируемая ячейка
const EditableCell: React.FC<{ value: number; rowIndex: number; colIndex: number; updateValue: (rowIndex: number, colIndex: number, newValue: number) => void }> = ({
  value, rowIndex, colIndex, updateValue
}) => {
  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const newValue = parseFloat(e.target.value);
    if (!isNaN(newValue)) {
      updateValue(rowIndex, colIndex, Math.round(newValue * 100) / 100); // Ограничиваем до 2 знаков после запятой
    }
  };

  return (
    <input
      type="number"
      step="0.01"
      value={value}
      onChange={handleChange}
      style={styles.cellInput}
    />
  );
};

const styles: { [key: string]: React.CSSProperties } = {
  container: {
    background: "#f9f9f9",
    borderRadius: "8px",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
    padding: "15px",
    textAlign: "center",
    margin: "10px 0",
  },
  title: {
    marginBottom: "10px",
    fontSize: "18px",
    fontWeight: "bold",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginBottom: "20px",
  },
  cell: {
    border: "1px solid #ccc",
    padding: "10px",
    textAlign: "center",
    minWidth: "50px",
    maxWidth: "50px",
    height: "50px",
  },
  cellInput: {
    width: "100%",
    border: "1px solid #ccc",
    borderRadius: "4px",
    textAlign: "center",
    fontSize: "14px",
    padding: "8px",
  },
  inputContainer: {
    display: "flex",
    flexDirection: "column",
    gap: "10px",
    marginTop: "20px",
  },
  inputLabel: {
    fontSize: "14px",
    fontWeight: "bold",
  },
  input: {
    padding: "8px",
    border: "1px solid #ccc",
    borderRadius: "4px",
    width: "100px",
    textAlign: "center",
  },
};

export default MatrixDisplay;
